import styled, { keyframes } from "styled-components";

const rotation = keyframes`
    to {
        transform: rotate(360deg);
    }
`

export const Bg = styled.img`
    width: 500%;
    object-fit: cover;
    animation: ${rotation} 50s linear infinite;
    position: absolute;
    top: -100%;
    left: -100%;
`
